import React from 'react';
import MenuItem from '../MenuItem/MenuItem.Component';

const Directory = () => (
    <div className="directory-menu">
        <MenuItem title='HATS'/>   
        <MenuItem title='JACKETS'/> 
        <MenuItem title='SNEAKERS'/> 
        <MenuItem title='MEN'/> 
        <MenuItem title='WOMEN'/>     
    </div>
)

export default Directory;
